(101, 'AWET AYU', 'mengandung formula \'anti aging\' yang berguna untuk menghambat proses penuaan seperti mengurangi keriput, memudarkan lingkaran hitam di mata dan dapat mengurangi kantung mata, membantu mengatasi penyakit keputihan, menghilangkan bau badan, merapatkan vagina, menjaga organ kewanitaan tetap bersih, mengurangi dan menghilangkan rasa sakit serta menjelang haid', '', 'sehari 10 pil, untuk pencegahan penyakit keputihan boleh ditingkatkan 2-3x sehari 10 pil', 'tidak ada', 'pil', 'TRESNA', 'Tromol Pos 01 Bangkalan', 'Jl.K.H Hasyim Asyari, Demangan', 'Bangkalan', '', 'AWET AYU mengandung formula \'anti aging\' yang berguna untuk menghambat proses penuaan seperti mengurangi keriput, memudarkan lingkaran hitam di mata dan dapat mengurangi kantung mata, membantu mengatasi penyakit keputihan, menghilangkan bau badan, merapatkan vagina, menjaga organ kewanitaan tetap bersih, mengurangi dan menghilangkan rasa sakit serta menjelang haid ', 'awet ayu kandung formula anti aging guna hambat proses tua kurang keriput pudar lingkar hitam mata kurang kantung mata bantu atas sakit putih hilang bau badan rapat vagina jaga organ wanita bersih kurang hilang sakit jelang haid'),
