(116, 'Galian singset ++', 'mengurangi kelebihan lemak (kolestrol) dalam tubuh, mengecilkan perut, menjaga bentuk tubuh yang ideal, menjaga penampilan selalu awet muda, membantu mengurangi lemak di tubuh, melangsingkan badan, membuat tampil seksi dan percaya diri, menormalkan BAB yang tidak lancar', '', '', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'Galian singset ++ mengurangi kelebihan lemak (kolestrol) dalam tubuh, mengecilkan perut, menjaga bentuk tubuh yang ideal, menjaga penampilan selalu awet muda, membantu mengurangi lemak di tubuh, melangsingkan badan, membuat tampil seksi dan percaya diri, menormalkan BAB yang tidak lancar ', 'gali singset kurang lebih lemak kolestrol tubuh kecil perut jaga bentuk tubuh ideal jaga tampil awet muda bantu kurang lemak tubuh langsing badan tampil seksi percaya normal bab lancar'),
(117, 'asi booster', 'melancarkan asi, menyegarkan badan muka tidak pucat, menyehatkan ibu dan bayi yang dilahirkan, menuntaskan sisa darah, meningkatkan kualitas nutrisi dalam asi', 'flore insertus, venerable aerospace, kunyit putih dll', '2x sehari 5 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'asi booster melancarkan asi, menyegarkan badan muka tidak pucat, menyehatkan ibu dan bayi yang dilahirkan, menuntaskan sisa darah, meningkatkan kualitas nutrisi dalam asi flore insertus, venerable aerospace, kunyit putih dll', 'asi booster lancar asi segar badan muka pucat sehat bayi lahir tuntas sisa darah tingkat kualitas nutrisi asi flore insertus venerable aerospace kunyit putih dll'),
(118, 'gadis remaja', 'menghilangkan bau badan yang kurang sedap, mencegah tumbuhnya jerawat, menyembuhkan keputihan, menjaga bentuk tubuh tetap ideal', 'tembakau, temulawak hitam, kunyit, cubeba', '2x sehari 2 kapsul', 'tidak ada', 'kapsul', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'gadis remaja menghilangkan bau badan yang kurang sedap, mencegah tumbuhnya jerawat, menyembuhkan keputihan, menjaga bentuk tubuh tetap ideal tembakau, temulawak hitam, kunyit, cubeba', 'gadis remaja hilang bau badan sedap cegah tumbuh jerawat sembuh putih jaga bentuk tubuh ideal tembakau temulawak hitam kunyit cubeba'),
(119, 'empot-empot', 'menambah kemesraan dan keharmonisan keluarga, kembali muda bagaikan gadis remaja, membuat suami makin sayang sama istri, kenikmatan dan kepuasan selalu menjelma', '', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'empot-empot menambah kemesraan dan keharmonisan keluarga, kembali muda bagaikan gadis remaja, membuat suami makin sayang sama istri, kenikmatan dan kepuasan selalu menjelma ', 'empot empot tambah mesra harmonis keluarga muda gadis remaja suami sayang istri nikmat puas jelma'),
(120, 'sehat lelaki', 'menambah semangat stamina dan kesehatan, menguatkan dan menghangatkan badan, pegal linu otot kaku dan lesu', '', '5 pil 2x sehari 2 kapsul 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'sehat lelaki menambah semangat stamina dan kesehatan, menguatkan dan menghangatkan badan, pegal linu otot kaku dan lesu ', 'sehat lelaki tambah semangat stamina sehat kuat hangat badan pegal linu otot kaku lesu'),
(121, 'rapet harum asmara', 'merapatkan dan melenturkan miss v, mengatasi bau tak sedap, serta gatal-gatal disekitar organ intim, mengatasi cairan berlebih, mengaharumkan area vagina, menjaga keharmonisan hubungan suami istri, menyembuhkan keputihan, serta gejalanya', 'galalit, kunyit, temulawak hitam, kencur putih', '2x sehari 5 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'rapet harum asmara merapatkan dan melenturkan miss v, mengatasi bau tak sedap, serta gatal-gatal disekitar organ intim, mengatasi cairan berlebih, mengaharumkan area vagina, menjaga keharmonisan hubungan suami istri, menyembuhkan keputihan, serta gejalanya galalit, kunyit, temulawak hitam, kencur putih', 'rapet harum asmara rapat lentur miss v atas bau sedap gatal gatal sekitar organ intim atas cair lebih mengaharumkan area vagina jaga harmonis hubung suami istri sembuh putih gejala galalit kunyit temulawak hitam kencur putih'),
(122, 'feminia', 'menjaga miss v tetap keset elastis, menambah libido, menghilangkan bau badann dan miss v yang kurang sedap, menyembuhkan keputihan, menjaga payudara tetap kenyal dan montok, melindungi rahim dari berbagai virus, menormalkan hormon estrogen, menghangatkan badan, mengurangi pegel-pegel/linu', 'galalit, temulawak hitam, kencur putih, dll', '2x sehari 5 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'feminia menjaga miss v tetap keset elastis, menambah libido, menghilangkan bau badann dan miss v yang kurang sedap, menyembuhkan keputihan, menjaga payudara tetap kenyal dan montok, melindungi rahim dari berbagai virus, menormalkan hormon estrogen, menghangatkan badan, mengurangi pegel-pegel/linu galalit, temulawak hitam, kencur putih, dll', 'feminia jaga miss v keset elastis tambah libido hilang bau badann miss v sedap sembuh putih jaga payudara kenyal montok lindung rahim virus normal hormon estrogen hangat badan kurang gel gel linu galalit temulawak hitam kencur putih dll'),
(123, 'awet muda', 'memulihkan elastisitas organ intim wanita( kencangkan otot miss v), menghilangkan gatal-gatal, keputihan dan bau kurang menyenangkan, mencegah penuaan dini, menstabilkan PH asam dan mengurangi cairan( basah) berlebihan, meningkatkan hormon estrogen, menambah gairah dan tahan lama, peremajaan tubuh usai melahirkan/haid, mencegah kanker servix dan kanker payudara', 'manjakani, jinten hitam, jinten putih dll s/d 100%', '5pil 2x sehari/ 2 kapsul 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'awet muda memulihkan elastisitas organ intim wanita( kencangkan otot miss v), menghilangkan gatal-gatal, keputihan dan bau kurang menyenangkan, mencegah penuaan dini, menstabilkan PH asam dan mengurangi cairan( basah) berlebihan, meningkatkan hormon estrogen, menambah gairah dan tahan lama, peremajaan tubuh usai melahirkan/haid, mencegah kanker servix dan kanker payudara manjakani, jinten hitam, jinten putih dll s/d 100%', 'awet muda pulih elastisitas organ intim wanita kencang otot miss v hilang gatal gatal putih bau senang cegah tua stabil ph asam kurang cair basah tingkat hormon estrogen tambah gairah tahan remaja tubuh lahir haid cegah kanker servix kanker payudara manjakani jinten hitam jinten putih dll s d'),
(124, 'jakuat', 'memperbaiki stamina pria, meningkatkan kebugaran tubuh dalam hubungan pasutri, membantu mengatasi ejakulasi dini, mengentalkan sperma, menambah kejantanan pria', 'akar jahe, biji sirih kuning, jinten putih, madu raja dll sampai 100%', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'jakuat memperbaiki stamina pria, meningkatkan kebugaran tubuh dalam hubungan pasutri, membantu mengatasi ejakulasi dini, mengentalkan sperma, menambah kejantanan pria akar jahe, biji sirih kuning, jinten putih, madu raja dll sampai 100%', 'jakuat baik stamina pria tingkat bugar tubuh hubung pasutri bantu atas ejakulasi kental sperma tambah jantan pria akar jahe biji sirih kuning jinten putih madu raja dll'),
(125, 'sirih wangi', 'menghilangkan bau badan dan mulut, menyembuhkan radang tenggorokan dan gusi, mengatasi keputihan, menyembuhkan jerawat, menghaluskan kulit, melancarkan air seni, penambah tenaga/ stamina, mengurangi keringat berlebih, mengatasi penyakit kulit/gatal-gatal', 'Biji Sirih (Piper betle), Biji Sirih Hutan (Boesenbergia rotunda), Biji Kunyit (Curcuma longa),Biji Kabesak (Piper cubeba)', '2x sehari 3 kapsul', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'sirih wangi menghilangkan bau badan dan mulut, menyembuhkan radang tenggorokan dan gusi, mengatasi keputihan, menyembuhkan jerawat, menghaluskan kulit, melancarkan air seni, penambah tenaga/ stamina, mengurangi keringat berlebih, mengatasi penyakit kulit/gatal-gatal Biji Sirih (Piper betle), Biji Sirih Hutan (Boesenbergia rotunda), Biji Kunyit (Curcuma longa),Biji Kabesak (Piper cubeba)', 'sirih wangi hilang bau badan mulut sembuh radang tenggorok gusi atas putih sembuh jerawat halus kulit lancar air seni tambah tenaga stamina kurang keringat lebih atas sakit kulit gatal gatal biji sirih piper betle biji sirih hutan boesenbergia rotunda biji kunyit curcuma longa biji kabesak piper cubeba'),
(126, 'Rapet Wangi', 'membantu mengurangi lendir yang berlebihan pada daerah kewanitaan', '125mg Biji Ek Quercus indica, 62,5mg Biji Pinang (Areca catechu), 10mg Kulit Buah Jeruk, 41mg Madu Murni yang Diproses', '2x sehari 2-3 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'BPOM', 'Rapet Wangi membantu mengurangi lendir yang berlebihan pada daerah kewanitaan 125mg Biji Ek Quercus indica, 62,5mg Biji Pinang (Areca catechu), 10mg Kulit Buah Jeruk, 41mg Madu Murni yang Diproses', 'rapet wangi bantu kurang lendir daerah wanita mg biji ek quercus indica mg biji pinang areca catechu mg kulit buah jeruk mg madu murni proses'),
(127, 'bersih darah', 'melancarkan peredaran darah di dalam tubuh, membersihkan darah kotor yang ada di dalam tubuh, mengatasi gatal-gatal pada kulit, mengatasi / meringankan bisul, mengobati korengan dan beberapa masalah kulit lainnya, menyembuhkan serta mencegah jerawat', '', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'bersih darah melancarkan peredaran darah di dalam tubuh, membersihkan darah kotor yang ada di dalam tubuh, mengatasi gatal-gatal pada kulit, mengatasi / meringankan bisul, mengobati korengan dan beberapa masalah kulit lainnya, menyembuhkan serta mencegah jerawat ', 'bersih darah lancar edar darah tubuh bersih darah kotor tubuh atas gatal gatal kulit atas ringan bisul obat koreng kulit sembuh cegah jerawat'),
(128, 'kencing manis', 'mengobati kencing manis, menurunkan kadar gula seperti sering merasa haus, sering kencing terutama dimalam hari', '', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'kencing manis mengobati kencing manis, menurunkan kadar gula seperti sering merasa haus, sering kencing terutama dimalam hari ', 'kencing manis obat kencing manis turun kadar gula haus kencing malam'),
(129, 'sari rapat', 'menambah gairah hubungan suami istri, mengobati keputihan dan gejalanya seperti berair, berlendir, berbau, merapatkan otot-otot vagina', '', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'sari rapat menambah gairah hubungan suami istri, mengobati keputihan dan gejalanya seperti berair, berlendir, berbau, merapatkan otot-otot vagina ', 'sari rapat tambah gairah hubung suami istri obat putih gejala air lendir bau rapat otot otot vagina'),
(130, 'delima putih', 'mencegah dan mengobati keputihan seperti muka pucat tidak bergairah sakit pinggang mengurangi lendir serta menghilangkan bau (keringat) kurang sedap, merapatkan vagina pemakaian secara teratur maka wajah bercahaya cantik & awet muda', '', '5 pil 2x sehari', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'delima putih mencegah dan mengobati keputihan seperti muka pucat tidak bergairah sakit pinggang mengurangi lendir serta menghilangkan bau (keringat) kurang sedap, merapatkan vagina pemakaian secara teratur maka wajah bercahaya cantik & awet muda ', 'delima putih cegah obat putih muka pucat gairah sakit pinggang kurang lendir hilang bau keringat sedap rapat vagina pakai atur wajah cahaya cantik awet muda'),
(131, 'empot-empot love', 'mengencangkan organ intim (rapet), mengencangkan kulit, menambah libido, atasi payudaya kendur, membersihkan bakteri dan jamur (keputihan), mengobati kista, mencegah kanker payudaram menguatkan pinggang, melancarkan datang bulan', 'Kayu parameria atau kayu putih, Temulawak hitam atau temulawak biru, Galalit, dll hingga 100%', '3x sehari 3 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'empot-empot love mengencangkan organ intim (rapet), mengencangkan kulit, menambah libido, atasi payudaya kendur, membersihkan bakteri dan jamur (keputihan), mengobati kista, mencegah kanker payudaram menguatkan pinggang, melancarkan datang bulan Kayu parameria atau kayu putih, Temulawak hitam atau temulawak biru, Galalit, dll hingga 100%', 'empot empot love encang organ intim rapet encang kulit tambah libido atas payudaya kendur bersih bakteri jamur putih obat kista cegah kanker payudaram kuat pinggang lancar kayu parameria kayu putih temulawak hitam temulawak biru galalit dll'),
(132, 'manjakani', 'menormalkan hormon estrogen, mengencangkan wajah dan kulit, mengencangkan payudara, mengencangkan otot-otot kewanitaan (rapet), mencegah osteoporosis (tulang keropos), menyembuhkan keputihan, menguatkan pinggang, melancarkan datang bulan', 'Galalit, Temulawak hitam atau temulawak biru, Kencur asli atau kencur putih', '2x sehari 3 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'manjakani menormalkan hormon estrogen, mengencangkan wajah dan kulit, mengencangkan payudara, mengencangkan otot-otot kewanitaan (rapet), mencegah osteoporosis (tulang keropos), menyembuhkan keputihan, menguatkan pinggang, melancarkan datang bulan Galalit, Temulawak hitam atau temulawak biru, Kencur asli atau kencur putih', 'manjakani normal hormon estrogen encang wajah kulit encang payudara encang otot otot wanita rapet cegah osteoporosis tulang keropos sembuh putih kuat pinggang lancar galalit temulawak hitam temulawak biru kencur asli kencur putih'),
(133, 'gemuk sehat', 'menambah nafsu makan, menghambat pertumbuhan sek kanker, meningkatkan daya tahan tubuh, menjaga kesehatan liver, memperbaiki jaringan tubuh yang rusak, membantu melawan bakteri dan jamur di tubuh, menyembuhkan penyakit kuning', 'Likoris, Temulawak hitam, Kayu manis asli, dll', '2x sehari 5 pil', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'gemuk sehat menambah nafsu makan, menghambat pertumbuhan sek kanker, meningkatkan daya tahan tubuh, menjaga kesehatan liver, memperbaiki jaringan tubuh yang rusak, membantu melawan bakteri dan jamur di tubuh, menyembuhkan penyakit kuning Likoris, Temulawak hitam, Kayu manis asli, dll', 'gemuk sehat tambah nafsu makan hambat tumbuh sek kanker tingkat daya tahan tubuh jaga sehat liver baik jaring tubuh rusak bantu lawan bakteri jamur tubuh sembuh sakit kuning likoris temulawak hitam kayu manis asli dll'),
(134, 'oil mahabbah', 'agar payudaya tetap kencang dan motok setelah melahirkan, merawat kesehatan payudara, menghaluskan kulit payudara', '', 'pijak payudara dengan oil mahabbah secukupnya, untuk hasil maksimal lakukan setiap hari secara rutin', 'tidak ada', 'cair', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'oil mahabbah agar payudaya tetap kencang dan motok setelah melahirkan, merawat kesehatan payudara, menghaluskan kulit payudara ', 'oil mahabbah payudaya kencang motok lahir rawat sehat payudara halus kulit payudara'),
(135, 'bubuk herbal ajaib', 'merapatkan dan mengencangkan otot vagina, mengeringkan miss v yang basah, sama-sama meberikan kenikmatan dan kebahagiaan hubungan suami istri', '', 'ambil bubuk sedikit, letakkan dijari yang telah dibersihkan masukkan ke miss v ', 'tidak ada', 'serbuk', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'bubuk herbal ajaib merapatkan dan mengencangkan otot vagina, mengeringkan miss v yang basah, sama-sama meberikan kenikmatan dan kebahagiaan hubungan suami istri ', 'bubuk herbal ajaib rapat encang otot vagina ering miss v basah meberikan nikmat bahagia hubung suami istri'),
(136, 'butiran putri delima', 'merapatkan dan mengencangkan otot vagina, keset/kering bikin wanita percaya diri, sama-sama meberikan kenikmatan dan kebahagiaan hubungan suami-istri', '', '', 'tidak ada', 'pil', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'butiran putri delima merapatkan dan mengencangkan otot vagina, keset/kering bikin wanita percaya diri, sama-sama meberikan kenikmatan dan kebahagiaan hubungan suami-istri ', 'butir putri delima rapat encang otot vagina keset kering bikin wanita percaya meberikan nikmat bahagia hubung suami istri'),
(137, 'penyubur kandungan', 'menguatkan rahim, menambah hormon menyuburkan kandungan', '', '1x sehari 1 sdm', 'tidak ada', 'selai', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'penyubur kandungan menguatkan rahim, menambah hormon menyuburkan kandungan ', 'subur kandung kuat rahim tambah hormon subur kandung'),
(138, 'setanggi zahra', 'bermanfaat sebagai aromatherapy menenangkan  hati dan menambah keintiman suami istri', 'gaharu, melati, kasturi, kulit jeruk, dll', 'dibakar dengan batu bara/arang atau dengan peralatan aromatherapy. Aroma yang muncul dapat langsung di uapkan pada rambut atau pakaian', 'tidak ada', '', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'setanggi zahra bermanfaat sebagai aromatherapy menenangkan  hati dan menambah keintiman suami istri gaharu, melati, kasturi, kulit jeruk, dll', 'setanggi zahra manfaat aromatherapy tenang hati tambah intim suami istri gaharu melati kasturi kulit jeruk dll'),
(139, 'timung / mandi uap', 'melancarkan peredaran darah, mengeluarkan keringat berlebih, membakar lemak, mengharumkan badan, membuat badan segar, harum dan berseri', '', 'rebus 1 atas 1/2 bungkus ramuantimung dengan air +- 1 liter', 'tidak ada', '', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'timung / mandi uap melancarkan peredaran darah, mengeluarkan keringat berlebih, membakar lemak, mengharumkan badan, membuat badan segar, harum dan berseri ', 'timung mandi uap lancar edar darah keluar keringat lebih bakar lemak harum badan badan segar harum seri'),
(140, 'hormolak', 'menstabilkan hormon laki-laki yang sangat diperlukan untuk produksi sperma, memberikan suplement tambahan sehingga produksi sperma dapat lebih maksimal, mempercepat produksi sperma dan memperbanyak jumlah cairan sprema, menghangatkan badan, mengurangi ejakulasi dini', '', 'setiap hari 1 sdm disampur kuning telur (tambahkan madu jika suka rasa manis) dan air panas secukupnya', 'tidak ada', 'selai', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'hormolak menstabilkan hormon laki-laki yang sangat diperlukan untuk produksi sperma, memberikan suplement tambahan sehingga produksi sperma dapat lebih maksimal, mempercepat produksi sperma dan memperbanyak jumlah cairan sprema, menghangatkan badan, mengurangi ejakulasi dini ', 'hormolak stabil hormon laki laki produksi sperma suplement tambah produksi sperma maksimal cepat produksi sperma banyak cair sprema hangat badan kurang ejakulasi'),
(141, 'lintah hitam papua', 'melancarkan sirkulasi darah, mengencangkan otot-otot yang kendor, meningkatkan kajantanan pria, mengobati lemah syahwat, ejakulasi dini, memperbesar dan memperpanjang penis.', '', 'oleskan keseluruh alat vital secara merata, kemudia diurut dari pangkal sampai keujung satu arah selama 5-10 menit setiap hari (minimal sehari sekali), diutamakan waktu pagi (bangun tidur pagi), dilakukan secara rutin dalam waktu singkat', 'tidak ada', 'krim', 'PT. Firdaus', 'Se-indonesia', 'Jl. Kh Lemah Duwur Gg. V Gg.IX No.60, Barat Tambak,Pejagan', 'Bangkalan', 'TDI & UKOT', 'lintah hitam papua melancarkan sirkulasi darah, mengencangkan otot-otot yang kendor, meningkatkan kajantanan pria, mengobati lemah syahwat, ejakulasi dini, memperbesar dan memperpanjang penis. ', 'lintah hitam papua lancar sirkulasi darah encang otot otot kendor tingkat kajantanan pria obat lemah syahwat ejakulasi besar panjang penis'),
(142, 'jamu gemuk sehat', 'membantu memperbaiki nafsu makan, menambah berat badan, menyelaraskan alat-alat pencernaan tubuh, menghilangkan letih, lesu, lemah dan kurang bersemangat', 'Ekstrak daun carica/papaya, Ekstrak akar curcuma biru, Ekstrak akar kunyit, Ekstrak akar kencur asli, Ekstrak akar kunyit domestika', '2x sehari 4 kapsul sesudah makan pagi dan malam', 'tidak ada', 'kapsul', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu gemuk sehat membantu memperbaiki nafsu makan, menambah berat badan, menyelaraskan alat-alat pencernaan tubuh, menghilangkan letih, lesu, lemah dan kurang bersemangat Ekstrak daun carica/papaya, Ekstrak akar curcuma biru, Ekstrak akar kunyit, Ekstrak akar kencur asli, Ekstrak akar kunyit domestika', 'jamu gemuk sehat bantu baik nafsu makan tambah berat badan selaras alat alat cerna tubuh hilang letih lesu lemah semangat ekstrak daun carica papaya ekstrak akar curcuma biru ekstrak akar kunyit ekstrak akar kencur asli ekstrak akar kunyit domestika'),
(143, 'jamu sepet madura *empot-empot)', 'membantu mengurangi lendir yang berlebihan pada daerah kewanitaan, memperkuat otot-otot vagina untuk membuat denyut-denyut istimewa pada vagina, mengeraskan otot vagina, menghilangkan keputihan dan gatal-gatal', 'Ekstrak biji jintan hitam, kstrak kulit kayu massalah, Ekstrak biji ketumbar, Ekstrak kulit pohon paramaria', '2x sehari 4 kapsul sesudah makan pagi dan malam', 'tidak ada', 'kapsul', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu sepet madura *empot-empot) membantu mengurangi lendir yang berlebihan pada daerah kewanitaan, memperkuat otot-otot vagina untuk membuat denyut-denyut istimewa pada vagina, mengeraskan otot vagina, menghilangkan keputihan dan gatal-gatal Ekstrak biji jintan hitam, kstrak kulit kayu massalah, Ekstrak biji ketumbar, Ekstrak kulit pohon paramaria', 'jamu sepet madura empot empot bantu kurang lendir daerah wanita kuat otot otot vagina denyut denyut istimewa vagina keras otot vagina hilang putih gatal gatal ekstrak biji jintan hitam kstrak kulit kayu massa ekstrak biji ketumbar ekstrak kulit pohon paramaria'),
