(156, 'galian singset', 'membantu mengurangi lemak, membuat badan menjadi langsing', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'galian singset membantu mengurangi lemak, membuat badan menjadi langsing ', 'gali singset bantu kurang lemak badan langsing'),
(157, 'jamu jerawat', 'membantu mengatasi jerawat, menjaga kulit tetap halus bercahaya', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu jerawat membantu mengatasi jerawat, menjaga kulit tetap halus bercahaya ', 'jamu jerawat bantu atas jerawat jaga kulit halus cahaya'),
(158, 'jamu pelangsing(bobot idaman)', 'menurunkan berat badan sesuai dengan idaman, menahan bobot badan supaya tidak gemuk berlebihan, mengontrol kadar lemak bagian perut', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu pelangsing(bobot idaman) menurunkan berat badan sesuai dengan idaman, menahan bobot badan supaya tidak gemuk berlebihan, mengontrol kadar lemak bagian perut ', 'jamu langsing bobot idam turun berat badan sesuai idam tahan bobot badan gemuk kontrol kadar lemak perut'),
(159, 'jamu pegel linu', 'sangat berkhasiat menyembuhkan pegel-pegel linu otot-otot anda, menyembuhkan penyakit rheumatic/encok dan sakit pinggang', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu pegel linu sangat berkhasiat menyembuhkan pegel-pegel linu otot-otot anda, menyembuhkan penyakit rheumatic/encok dan sakit pinggang ', 'jamu gel linu khasiat sembuh gel gel linu otot otot sembuh sakit rheumatic encok sakit pinggang'),
(160, 'jamu nifas (pluntur)', 'sangat efektif untuk wanita yang sering terlambat bulan, datang bulan tidak teratur, sakit-sakit badan waktu datang bulan', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'jamu nifas (pluntur) sangat efektif untuk wanita yang sering terlambat bulan, datang bulan tidak teratur, sakit-sakit badan waktu datang bulan ', 'jamu nifas pluntur efektif wanita lambat atur sakit sakit badan'),
(161, 'sehat lelaki (perkasa lelaki)', 'Memperkuat fungsi lelaki serta meningkatkan katahanan kejantanan', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'sehat lelaki (perkasa lelaki) Memperkuat fungsi lelaki serta meningkatkan katahanan kejantanan ', 'sehat lelaki perkasa lelaki kuat fungsi lelaki tingkat katahanan jantan'),
(162, 'sepet madura(empot-empotan', 'membuat denyut-denyut istimewa yang khas, memperkuat otot-otot kewanitaan, menghilangkan bau tidak enak gatal-gatal dan keputihan', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'sepet madura(empot-empotan membuat denyut-denyut istimewa yang khas, memperkuat otot-otot kewanitaan, menghilangkan bau tidak enak gatal-gatal dan keputihan ', 'sepet madura empot empot denyut denyut istimewa khas kuat otot otot wanita hilang bau enak gatal gatal putih'),
(163, 'sehat perempuan(montok payudaya)', 'mengencangkan payudara, memperbesar payudara yang kurang ideal, menyehatkan dan memperindah payudara', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'sehat perempuan(montok payudaya) mengencangkan payudara, memperbesar payudara yang kurang ideal, menyehatkan dan memperindah payudara ', 'sehat perempuan montok payudaya encang payudara besar payudara ideal sehat indah payudara'),
(164, 'sari harum(keputihan)', 'sangat mujarab dan benar-benar ampuh untuk segala macam keputihan yang lama maupun yang baru. Menghilangkan bau yang tidak enak, gatal-gatal dll', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'sari harum(keputihan) sangat mujarab dan benar-benar ampuh untuk segala macam keputihan yang lama maupun yang baru. Menghilangkan bau yang tidak enak, gatal-gatal dll ', 'sari harum putih mujarab ampuh putih hilang bau enak gatal gatal dll'),
(165, 'awet ayu', 'membuat dan menjaga kulit tubuh anda segar halus dan bercahaya, mengencangkan seluruh otot-otot tubuh anda agar tetap singset. Menjaga tubuh tetap sehat dan segar selalu', '', '', '', '', 'ribkah maryam jokotole', 'Se-indonesia', 'Jl.KHA. Marzuki 68 B', 'Bangkalan', 'BPOM', 'awet ayu membuat dan menjaga kulit tubuh anda segar halus dan bercahaya, mengencangkan seluruh otot-otot tubuh anda agar tetap singset. Menjaga tubuh tetap sehat dan segar selalu ', 'awet ayu jaga kulit tubuh segar halus cahaya encang otot otot tubuh singset jaga tubuh sehat segar');
INSERT INTO `jamu` (`ID_JAMU`, `NAMA_JAMU`, `KHASIAT`, `KANDUNGAN`, `ATURAN_MINUM`, `EFEK_SAMPING`, `JENIS`, `PRODUSEN`, `LOKASI_PEMASARAN`, `LOKASI_PRODUKSI`, `KABUPATEN`, `PERIZINAN`, `METADATA`, `PREPRO_METADATA`) VALUES
(166, 'SUPER SEHAT BURUNG WALET', 'Insya Allah sangat ampuh untuk mencegah dan menyembuhkan Reumatik, Asam urat, Tekanan darah tinggi, Asma, Maag, Ginjal, Tipes, Cacingan, Sakit gigi, Lemah syahwat, Gatal-gatal alergi, Paru-paru basah, Kurang nafsu makan, Melancarkan Sirkulasi darah, Jerawat, Bisul, Kudis, Panu, Merawat Ms.V, Mengatasi keputihan, Merawat dan mengencangkan kulit, Mencegah dan mengatasi penyakit menahun, Kelumpuhan/badan mati separuh seperti Stroke, Kanker, Liver, Kencing manis basah/kencing manis kering, Menjaga dan menambah ', 'Rimpang Kunyit,Rimpang Kencur, Rimpang Jahe, Herba Sambiloto', 'pengobatan, dewasa 1 sendok makan 2x sehari. Anak-anak 1/2 sendok makan 2x sehari diseduh dengan air matang 200 ml. untuk menjaga badan tetap sehat dan bugar diminum rutin 1x sehari', 'Jamu walet super sehat dapat mengakibatkan sering buang air besar, sering buang air kecil, keringat berlebih, mual dan muntah, namun efek samping berikut hanya bersifat sementara sesuai dengan tingkat/level penyakit yang diderita.', 'serbuk', 'PT.QOMAR JAYA NUSANTARA', 'online', 'Sumenep', 'Sumenep', 'KEMENKES', 'SUPER SEHAT BURUNG WALET Insya Allah sangat ampuh untuk mencegah dan menyembuhkan Reumatik, Asam urat, Tekanan darah tinggi, Asma, Maag, Ginjal, Tipes, Cacingan, Sakit gigi, Lemah syahwat, Gatal-gatal alergi, Paru-paru basah, Kurang nafsu makan, Melancarkan Sirkulasi darah, Jerawat, Bisul, Kudis, Panu, Merawat Ms.V, Mengatasi keputihan, Merawat dan mengencangkan kulit, Mencegah dan mengatasi penyakit menahun, Kelumpuhan/badan mati separuh seperti Stroke, Kanker, Liver, Kencing manis basah/kencing manis keri', 'super sehat burung walet insya allah ampuh cegah sembuh reumatik asam urat tekan darah asma maag ginjal tipes cacing sakit gigi lemah syahwat gatal gatal alergi paru paru basah nafsu makan lancar sirkulasi darah jerawat bisul kudis panu rawat ms v atas putih rawat encang kulit cegah atas sakit tahun lumpuh badan mati paruh stroke kanker liver kencing manis basah kencing manis kering jaga tambah daya tahan tubuh rimpang kunyit rimpang kencur rimpang jahe herba sambiloto'),
(167, 'SUPER KUAT BURUNG WALET', 'Insyaallah sangat ampuh untuk menambah kepuasan Sex, Tahan keluarnya air sperma, menambah kejantanan, mengencangkan otot dzakar, menguatkan dan mengobati impoten yang menahun, merangsang dan mempercepat hidupnya dzakar, menambah energi baru setelah berhubungan, mengganti sel-sel tubuh yang aus, mengobati lesu, loyo, sakit pinggang, sakit kepala, dan menambah daya tahan tubuh dan menambah vitalitas pria dan wanita.', '10% Ekstrak Kopi Rempah, 15% Kulit Batang Kayu Manis (Cassia), 20% Daun Psidium', 'Sehari 2 bungkus diminum pagi dan sore/malam 25menit-1 jam sebelum tidur (Boleh dicampur dengan telur ayam kampung dan madu) Untuk menjaga tubuh tetap sehat diminum 1 hari sekali.', '', 'serbuk', 'PT.QOMAR JAYA NUSANTARA', 'online', 'Sumenep', 'Sumenep', 'KEMENKES', 'SUPER KUAT BURUNG WALET Insyaallah sangat ampuh untuk menambah kepuasan Sex, Tahan keluarnya air sperma, menambah kejantanan, mengencangkan otot dzakar, menguatkan dan mengobati impoten yang menahun, merangsang dan mempercepat hidupnya dzakar, menambah energi baru setelah berhubungan, mengganti sel-sel tubuh yang aus, mengobati lesu, loyo, sakit pinggang, sakit kepala, dan menambah daya tahan tubuh dan menambah vitalitas pria dan wanita. 10% Ekstrak Kopi Rempah, 15% Kulit Batang Kayu Manis (Cassia), 20% Dau', 'super kuat burung walet insyaallah ampuh tambah puas sex tahan keluar air sperma tambah jantan encang otot dzakar kuat obat impoten tahun rangsang cepat hidup dzakar tambah energi hubung ganti sel sel tubuh aus obat lesu loyo sakit pinggang sakit kepala tambah daya tahan tubuh tambah vitalitas pria wanita ekstrak kopi rempah kulit batang kayu manis cassia daun psidium'),
(168, 'KOPI JANTAN ANTI DIABETES', 'Insya Allah sangat ampuh untuk mengatasi penyakit diabetes, lemah syahwat, ejakulasi dini, meningkatkan libido, menambah stamina, vitalitas dan meningkatkan daya tahan tubuh pria dan wanita.', '15% Ekstrak Kopi Rempah, 10% Ekstrak Andrografis, 20% Ekstrak Akar Ginseng, 20% Ekstrak Rimpang Jahe Merah, Dan bahan lainnya hingga total 100%.', 'Terapi pengobatan sehari 2 bungkus diminum pagi dan malam hari. Untuk menjaga tubuh tetap sehat 1 bungkus diminum satu kali sehari.', '', 'serbuk', 'PT.QOMAR JAYA NUSANTARA', 'online', 'Sumenep', 'Sumenep', 'KEMENKES', 'KOPI JANTAN ANTI DIABETES Insya Allah sangat ampuh untuk mengatasi penyakit diabetes, lemah syahwat, ejakulasi dini, meningkatkan libido, menambah stamina, vitalitas dan meningkatkan daya tahan tubuh pria dan wanita. 15% Ekstrak Kopi Rempah, 10% Ekstrak Andrografis, 20% Ekstrak Akar Ginseng, 20% Ekstrak Rimpang Jahe Merah, Dan bahan lainnya hingga total 100%.', 'kopi jantan anti diabetes insya allah ampuh atas sakit diabetes lemah syahwat ejakulasi tingkat libido tambah stamina vitalitas tingkat daya tahan tubuh pria wanita ekstrak kopi rempah ekstrak andrografis ekstrak akar ginseng ekstrak rimpang jahe merah bahan total'),
(169, 'MADU Ruqyah', 'Insya Allah dapat mencegah dan Menyembuhkan segala macam penyakit: Diabetes, Kolesterol, Asam Urat, Asam Lambung, Alergi, Ginjal, Asthma, Maag, Darah Tinggi, Lever, Kanker, Kusta, Stroke, Lumpuh, Keputihan, Meningkatkan gairah sex pria/wanita, kesulitan mendapatkan keturunan, Gangguan Jin/Psikis, dan kena Sihir/Santet', 'Madu Pahit, Sarang Burung Walet, Habbatus Saudah', '2X sehari, 1 sendok makan diseduh dengan air hangat 200ml, diminum sebelum makan dan sebelum tidur. untuk mendapat hasil maksimal diminum secara rutin dan teratur.', '', 'cair', 'PT.QOMAR JAYA NUSANTARA', 'online', 'Sumenep', 'Sumenep', 'KEMENKES', 'MADU Ruqyah Insya Allah dapat mencegah dan Menyembuhkan segala macam penyakit: Diabetes, Kolesterol, Asam Urat, Asam Lambung, Alergi, Ginjal, Asthma, Maag, Darah Tinggi, Lever, Kanker, Kusta, Stroke, Lumpuh, Keputihan, Meningkatkan gairah sex pria/wanita, kesulitan mendapatkan keturunan, Gangguan Jin/Psikis, dan kena Sihir/Santet Madu Pahit, Sarang Burung Walet, Habbatus Saudah', 'madu ruqyah insya allah cegah sembuh sakit diabetes kolesterol asam urat asam lambung alergi ginjal asthma maag darah lever kanker kusta stroke lumpuh putih tingkat gairah sex pria wanita sulit turun ganggu jin psikis kena sihir santet madu pahit sarang burung walet habbatus saudah'),
(170, 'SUSU SUPER SEHAT GOLD', 'Mengatasi kencing manis basah/kering, Diabetes, Asam urat, Liver, Kanker, Mudah lesu/loyo/letih/kurang semangat atau kurang energik, Merawat dan memperkuat otot Mr.P, Menambah stamina pria dan wanita, Merawat dan mengencangkan Ms V, Mengatasi keputihan, Lendir berlebih pada Ms,V, Bau badan tidak sedap, Kurang darah, Jerawat, bisul, kudis dan sejenisnya, Merawat, mengencangkan dan mengatasi kulit mati/ mudah kering, Menambah nafsu makan, baik untuk dewasa ataupun bagi anak-anak(usia minimal 5 tahun), Menamba', 'Terbuat dari biji kedelai pilihan, sarang burung walet, pemanis alami dari sari bunga dan tebu, akar tanaman, dan bahan-bahan khsus lainnya yang 100 alami dan asli dari madura', 'Aman diminum sebelum atau sesudah makan, namun kami anjurkan untuk diminum sesudah makan dan 2 jam sebelum tidur', '', 'serbuk', 'PT.QOMAR JAYA NUSANTARA', 'online', 'Sumenep', 'Sumenep', 'KEMENKES', 'SUSU SUPER SEHAT GOLD Mengatasi kencing manis basah/kering, Diabetes, Asam urat, Liver, Kanker, Mudah lesu/loyo/letih/kurang semangat atau kurang energik, Merawat dan memperkuat otot Mr.P, Menambah stamina pria dan wanita, Merawat dan mengencangkan Ms V, Mengatasi keputihan, Lendir berlebih pada Ms,V, Bau badan tidak sedap, Kurang darah, Jerawat, bisul, kudis dan sejenisnya, Merawat, mengencangkan dan mengatasi kulit mati/ mudah kering, Menambah nafsu makan, baik untuk dewasa ataupun bagi anak-anak(usia min', 'susu super sehat gold atas kencing manis basah kering diabetes asam urat liver kanker mudah lesu loyo letih semangat energik rawat kuat otot mr p tambah stamina pria wanita rawat encang ms v atas putih lendir lebih ms v bau badan sedap darah jerawat bisul kudis jenis rawat encang atas kulit mati mudah kering tambah nafsu makan dewasa anak anak usia minimal tambah berat badan tambah nafsu makan dii inti multi khas buat biji kedelai pilih sarang burung walet man alami sari bunga tebu akar tanam bahan bahan kh'),
(171, 'SUBUR KANDUNGAN', 'dapat menyuburkan kandungan. Baik untuk ibu yang baru keguguran', '', '', '', '', 'Karya Ibu Abdullah', 'online', '', 'Pamekasan', 'KEMENKES', 'SUBUR KANDUNGAN dapat menyuburkan kandungan. Baik untuk ibu yang baru keguguran ', 'subur kandung subur kandung gugur'),
(172, 'SABUN CAIR SIRIH', 'harum dan keset pembersih daerah khusus kewanitaan', '', '', '', 'cair', 'UD.MUSTIKA BANI', 'online', '', '', '', 'SABUN CAIR SIRIH harum dan keset pembersih daerah khusus kewanitaan ', 'sabun cair sirih harum keset bersih daerah khusus wanita'),
(173, 'krim rondo ayu', 'Khasiat dapat mengencangkan payudara yang turun. Disarankan diminum dengan kapsul montok payudara untuk hasil yang maksimal.', '', '', '', 'krim', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'krim rondo ayu Khasiat dapat mengencangkan payudara yang turun. Disarankan diminum dengan kapsul montok payudara untuk hasil yang maksimal. ', 'krim rondo ayu khasiat encang payudara turun saran minum kapsul montok payudara hasil maksimal'),
(174, 'harum rempah spray(perfume)', 'Dapat menghilangkan bau badan. Bisa digunakan untuk ketiak, leher, kaki, dan rambut.', '', '', '', 'cair', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'harum rempah spray(perfume) Dapat menghilangkan bau badan. Bisa digunakan untuk ketiak, leher, kaki, dan rambut. ', 'harum rempah spray perfume hilang bau badan ketiak leher kaki rambut'),
(175, 'virginity spray', 'dapat membuat wangi bagian bawah', '', '', '', 'cair', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'virginity spray dapat membuat wangi bagian bawah ', 'virginity spray wangi'),
(176, 'empot-empot ayam super', 'Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Mencegah dan menghilangkan bau tidak sedap pada bagian kewanitaan dan menghilangkan bau badan, Mengencangkan kembali otot² kewanitaan setelah melahirkan, Mengembalikan kegadisan / keperawanan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas', '', '', '', 'pil', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'empot-empot ayam super Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Mencegah dan menghilangkan bau tidak sedap pada bagian kewanitaan dan menghilangkan bau badan, Mengencangkan kembali otot² kewanitaan setelah melahirkan, Mengembalikan kegadisan / keperawanan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas ', 'empot empot ayam super gairah hubung suami istri serap lebih lendir putih cegah hilang bau sedap wanita hilang bau badan encang otot wanita lahir kembali gadis perawan anjur minum haid nifas'),
(177, 'galian rapet awet muda', 'Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Mencegah dan menghilangkan bau tidak sedap pada bagian kewanitaan dan menghilangkan bau badan, Dapat dikonsumsi oleh gadis / remaja, Mengembalikan kegadisan / keperawanan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas', '', '', '', 'pil', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'galian rapet awet muda Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Mencegah dan menghilangkan bau tidak sedap pada bagian kewanitaan dan menghilangkan bau badan, Dapat dikonsumsi oleh gadis / remaja, Mengembalikan kegadisan / keperawanan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas ', 'gali rapet awet muda gairah hubung suami istri serap lebih lendir putih cegah hilang bau sedap wanita hilang bau badan konsumsi gadis remaja kembali gadis perawan anjur minum haid nifas'),
(178, 'serbuk nikmat surga', 'Menambah rasa kenikmatan dalam bersetubuh, Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Menghilangkan bau tidak sedap pada bagian kewanitaan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas', '', '', '', 'serbuk', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'serbuk nikmat surga Menambah rasa kenikmatan dalam bersetubuh, Menggairahkan kembali hubungan suami istri, Menyerap kelebihan lendir (keputihan), Menghilangkan bau tidak sedap pada bagian kewanitaan, Tidak dianjurkan diminum ketika sedang masa haid/masa nifas ', 'serbuk nikmat surga tambah nikmat tubuh gairah hubung suami istri serap lebih lendir putih hilang bau sedap wanita anjur minum haid nifas'),
(179, 'Bedak madu', 'Mengangkat sel² kulit mati, Mencegah timbulnya jerawat, Menghilangkan flek hitam di wajah, Menghilangkan mata panda, menghilangkan biang keringat', '', '', '', 'pil', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', '', 'Bedak madu Mengangkat sel² kulit mati, Mencegah timbulnya jerawat, Menghilangkan flek hitam di wajah, Menghilangkan mata panda, menghilangkan biang keringat ', 'bedak madu angkat sel kulit mati cegah timbul jerawat hilang flek hitam wajah hilang mata panda hilang biang keringat'),
(180, 'Gemuk Sehat', 'Menambah nafsu makan, Membersihkan jerawat, Menghaluskan kulit, Menghilangkan bau mulut dan bau badan, Membuat tubuh padat berisi (montok), Menambah semangat kerja', '10% Kayu Secang, 10% Kulit Batang Kayu Manis (Cassia), 15% Buah Fomiculli (Pastikan penulisan yang benar), 10% Bunga Cengkeh, Dan bahan lainnya hingga total 100%.', '', '', 'kapsul', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'BPOM', 'Gemuk Sehat Menambah nafsu makan, Membersihkan jerawat, Menghaluskan kulit, Menghilangkan bau mulut dan bau badan, Membuat tubuh padat berisi (montok), Menambah semangat kerja 10% Kayu Secang, 10% Kulit Batang Kayu Manis (Cassia), 15% Buah Fomiculli (Pastikan penulisan yang benar), 10% Bunga Cengkeh, Dan bahan lainnya hingga total 100%.', 'gemuk sehat tambah nafsu makan bersih jerawat halus kulit hilang bau mulut bau badan tubuh padat isi montok tambah semangat kerja kayu secang kulit batang kayu manis cassia buah fomiculli pasti tulis bunga cengkeh bahan total'),
(181, 'Montok Payudara', 'Membuat tubuh montok dan berisi, Melangsingkan dan menyingsetkan tubuh, Mengencangkan payudara, Menghilangkan pegal² dan kecapean, Menambah semangat kerja, Menggantikan sel² kulit mati dengan segera, Kulit menjadi halus dan berseri', '', '', '', 'kapsul', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'KEMENKES', 'Montok Payudara Membuat tubuh montok dan berisi, Melangsingkan dan menyingsetkan tubuh, Mengencangkan payudara, Menghilangkan pegal² dan kecapean, Menambah semangat kerja, Menggantikan sel² kulit mati dengan segera, Kulit menjadi halus dan berseri ', 'montok payudara tubuh montok isi langsing singset tubuh encang payudara hilang pegal cape tambah semangat kerja ganti sel kulit mati kulit halus seri'),
(182, 'Peluntur Lemak', 'Melarutkan lemak dalam tubuh, Mengurangi nafsu makan, Menyusutkan lemak perut, Menurunkan kolesterol, Melancarkan BAB', '', '', '', 'kapsul', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'BPOM', 'Peluntur Lemak Melarutkan lemak dalam tubuh, Mengurangi nafsu makan, Menyusutkan lemak perut, Menurunkan kolesterol, Melancarkan BAB ', 'luntur lemak larut lemak tubuh kurang nafsu makan susut lemak perut turun kolesterol lancar bab'),
(183, 'empot-empotan', 'Mengobati keputihan, Menyehatkan / menyingsetkan badan, Menambah gairah hubungan suami-istri, Mengobati gatal² dan menghilangkan bau badan dan bau mulut, Cocok bulanan, Menguatkan otot² muda kembali', '', '', '', 'kapsul', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'BPOM', 'empot-empotan Mengobati keputihan, Menyehatkan / menyingsetkan badan, Menambah gairah hubungan suami-istri, Mengobati gatal² dan menghilangkan bau badan dan bau mulut, Cocok bulanan, Menguatkan otot² muda kembali ', 'empot empot obat putih sehat singset badan tambah gairah hubung suami istri obat gatal hilang bau badan bau mulut cocok bulan kuat otot muda'),
(184, 'Kuat Semangat Helbeh Mutiara', 'Mengatasi lemah syahwat, sakit pinggang, rematik, encok dll, Helbeh mutiara ini merangsang otot dan syaraf yang lemah pada seluruh organ tubuh, Menghilangkan jantung berdebar, letih, lesu, dan asam urat, Menghilangkan nyeri tulang dan tambah darah', '', '', '', 'kapsul', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'BPOM', 'Kuat Semangat Helbeh Mutiara Mengatasi lemah syahwat, sakit pinggang, rematik, encok dll, Helbeh mutiara ini merangsang otot dan syaraf yang lemah pada seluruh organ tubuh, Menghilangkan jantung berdebar, letih, lesu, dan asam urat, Menghilangkan nyeri tulang dan tambah darah ', 'kuat semangat helbeh mutiara atas lemah syahwat sakit pinggang rematik encok dll helbeh mutiara rangsang otot syaraf lemah organ tubuh hilang jantung debar letih lesu asam urat hilang nyeri tulang darah'),
(185, 'jamu kuat Helbeh Mutiara', 'Menghilangkan rasa letih, Menambah tenaga /energi, Mengobati lemah syahwat, Mengobati jantung berdebar, Menghilangkan sakit pinggang, Menghilangkan rematik/encok, Mengurangi asam urat, Menghancurkan batu ginjal', '', '', '', 'cair', 'Karya Ibu Abdullah', 'madura', '', 'Pamekasan', 'BPOM', 'jamu kuat Helbeh Mutiara Menghilangkan rasa letih, Menambah tenaga /energi, Mengobati lemah syahwat, Mengobati jantung berdebar, Menghilangkan sakit pinggang, Menghilangkan rematik/encok, Mengurangi asam urat, Menghancurkan batu ginjal ', 'jamu kuat helbeh mutiara hilang letih tambah tenaga energi obat lemah syahwat obat jantung debar hilang sakit pinggang hilang rematik encok kurang asam urat hancur batu ginjal'),
(186, 'jamu kuat pria dewasa semalam di madura', 'meningkatkan stamina dan daya tubuh pria', '', '', '', '', 'PD Sakera Madura', '', '', '', 'KEMENKES', 'jamu kuat pria dewasa semalam di madura meningkatkan stamina dan daya tubuh pria ', 'jamu kuat pria dewasa malam madura tingkat stamina daya tubuh pria'),
(187, 'jamu helbeh semangat ramuan herbal madura', 'menguatkan badan, mencerdaskan otak, mencegah reumatik, menambah semangat, menyembuhkan batuk asma, menyembuhkan sakit pinggang', '', '', '', 'selai', 'JKU SUPER', '', '', 'Pamekasan', '', 'jamu helbeh semangat ramuan herbal madura menguatkan badan, mencerdaskan otak, mencegah reumatik, menambah semangat, menyembuhkan batuk asma, menyembuhkan sakit pinggang ', 'jamu helbeh semangat ramu herbal madura kuat badan cerdas otak cegah reumatik tambah semangat sembuh batuk asma sembuh sakit pinggang'),
(188, 'jamu sariwangi ramuan madura', 'untuk membantu menghilangkan bau mulut dan bau badan pada pria dan wanita, produk sari wangi ini merupakan jamu herbal yang bisa membantu menghilangkan bau mulut, bau badan dan keringat serta bau yang keluar dari tubuh manusia, dan juga bau yang keluar dari mulut yang bersumber dari perut dan pencernaan.', '', '', '', 'kapsul', 'jokotole', 'indonesia', '', 'Bangkalan', '', 'jamu sariwangi ramuan madura untuk membantu menghilangkan bau mulut dan bau badan pada pria dan wanita, produk sari wangi ini merupakan jamu herbal yang bisa membantu menghilangkan bau mulut, bau badan dan keringat serta bau yang keluar dari tubuh manusia, dan juga bau yang keluar dari mulut yang bersumber dari perut dan pencernaan. ', 'jamu sariwangi ramu madura bantu hilang bau mulut bau badan pria wanita produk sari wangi jamu herbal bantu hilang bau mulut bau badan keringat bau tubuh manusia bau mulut sumber perut cerna'),
(189, 'Serimpang', '', 'kunyit dan gula', 'larutkan 2 sdm ekstrak herbal kunyit dengan 150 ml air panas atau dingin', '', 'serbuk', 'UD. SIMPANG TIGA', '', '', 'Sampang', 'P-IRT', 'Serimpang  kunyit dan gula', 'rimpang kunyit gula'),
(190, 'Lancar darah', 'untuk melancarkan keluarnya darah pada waktu dan masa datang bulan, mencegah dan mengurangi sakit perut, sakit pinggang, pusing, dan nyeri yang timbul pada masa datang bulan', '', '', '', '', 'Madura Sari', '', '', 'sampang', 'KEMENKES', 'Lancar darah untuk melancarkan keluarnya darah pada waktu dan masa datang bulan, mencegah dan mengurangi sakit perut, sakit pinggang, pusing, dan nyeri yang timbul pada masa datang bulan ', 'lancar darah lancar keluar darah cegah kurang sakit perut sakit pinggang pusing nyeri timbul'),
(191, 'jamu tradisional madura kecantikan', 'menjaga agr badan tetap sehat, segar, awet muda dan mencegah timbulnya jerawat, melangsingkan tubuh dan mengencangkan tubuh, mengurangi bau badan', '', '', '', 'pil', 'Ny. Hj Hayati', '', '', 'Sampang', 'KEMENKES', 'jamu tradisional madura kecantikan menjaga agr badan tetap sehat, segar, awet muda dan mencegah timbulnya jerawat, melangsingkan tubuh dan mengencangkan tubuh, mengurangi bau badan ', 'jamu tradisional madura cantik jaga agr badan sehat segar awet muda cegah timbul jerawat langsing tubuh encang tubuh kurang bau badan'),
(192, 'jamu gendong klasik madura(JKM)', 'Menjaga kebersihan Miss V, Mencegah keputihan, Menghilangkan bau tak sedap, Menghilangkan gatal - gatal, Mengurangi lendir berlebih, Merapatkan miss V, Empot - Empot, Membuat Miss V lebih keset dan harum, Mengencangkan otot - otot Miss V, Cocok untuk ibu menyusui, Melancarkan HAID, Mendetox kotoran yg ada pada rahim', '', '', '', 'pil', 'JKM', '', '', '', '', 'jamu gendong klasik madura(JKM) Menjaga kebersihan Miss V, Mencegah keputihan, Menghilangkan bau tak sedap, Menghilangkan gatal - gatal, Mengurangi lendir berlebih, Merapatkan miss V, Empot - Empot, Membuat Miss V lebih keset dan harum, Mengencangkan otot - otot Miss V, Cocok untuk ibu menyusui, Melancarkan HAID, Mendetox kotoran yg ada pada rahim ', 'jamu gendong klasik madura jkm jaga bersih miss v cegah putih hilang bau sedap hilang gatal gatal kurang lendir lebih rapat miss v empot empot miss v keset harum encang otot otot miss v cocok susu lancar haid mendetox kotor yg rahim'),
(193, 'ramuan tradisional madura', 'asma, reumatik, tekanan darah tinggi, kencing manis, kencing batu, ginjal, amandel, tumor, migrain, lever alergi mag, mag, lemah jantung, exim, kurang nafsu makan, kurang darah, lemah syahwat, asam urat', '', '', '', 'serbuk', 'CV.WAHYU ILLAHI', '', 'Sumenep', 'Sumenep', 'BPOM', 'ramuan tradisional madura asma, reumatik, tekanan darah tinggi, kencing manis, kencing batu, ginjal, amandel, tumor, migrain, lever alergi mag, mag, lemah jantung, exim, kurang nafsu makan, kurang darah, lemah syahwat, asam urat ', 'ramu tradisional madura asma reumatik tekan darah kencing manis kencing batu ginjal amandel tumor migrain lever alergi mag mag lemah jantung exim nafsu makan darah lemah syahwat asam urat'),
(194, 'jamu sehat bugar', 'Membantu menyembuhkan, Asma, Sebagai obat Reumatik, Bisa mengobati Tekanan, Darah Tinggi, Dapat membantu menyembuhkan, Kencing Manis (diabetes), Dapat membantu menyembuhkan Kencing Batu, Bisa Membantu menyembuhkan Penyakit, Ginjal, Membantu menyembuhkan Amandel, Membantu Menyembuhkan,Tumor, Dapat membantu menyembuhkan, Migrain (sakit kepala), Bisa membantu menyembuhkan, Lever atau hepatitis, Dapat membantu menyembuhkan, Alergi, Bisa membantu menyembuhkan, Menyembuhkan Mag, Dapat membantu menyembuhkan, Lemah', 'temulawak 3,75 gram,  rimpang jahe 3 gram, kencur 3 gram, kayu manis 2,25 gram, laos 2,70, kopi arabica 0,30 gram', '', '', 'serbuk', 'CV.WAHYU ILLAHI', '', 'Sumenep', 'Sumenep', 'BPOM', 'jamu sehat bugar Membantu menyembuhkan, Asma, Sebagai obat Reumatik, Bisa mengobati Tekanan, Darah Tinggi, Dapat membantu menyembuhkan, Kencing Manis (diabetes), Dapat membantu menyembuhkan Kencing Batu, Bisa Membantu menyembuhkan Penyakit, Ginjal, Membantu menyembuhkan Amandel, Membantu Menyembuhkan,Tumor, Dapat membantu menyembuhkan, Migrain (sakit kepala), Bisa membantu menyembuhkan, Lever atau hepatitis, Dapat membantu menyembuhkan, Alergi, Bisa membantu menyembuhkan, Menyembuhkan Mag, Dapat membantu me', 'jamu sehat bugar bantu sembuh asma obat reumatik obat tekan darah bantu sembuh kencing manis diabetes bantu sembuh kencing batu bantu sembuh sakit ginjal bantu sembuh amandel bantu sembuh tumor bantu sembuh migrain sakit kepala bantu sembuh lever hepatitis bantu sembuh alergi bantu sembuh sembuh mag bantu sembuh lemah jantung bantu obat eksim sakit kulit tambah nafsu makan bantu sembuh darah bantu sembuh lemah syahwat bantu sembuh asam urat temulawak gram rimpang jahe gram kencur gram kayu manis gram laos k'),
(195, 'galian singset (susut perut)', 'untuk mengurangi lemak dalam tubuh', '30% Daun Guazumae, 10% Bunga Cengkeh, 15% Rimpang Temulawak, 15% Rimpang Jahe, 15% Kulit Batang Kayu Manis (Cassia), Dan bahan lainnya hingga total 100%.', '', '', 'selai', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69115', 'bangkalan', 'BPOM', 'galian singset (susut perut) untuk mengurangi lemak dalam tubuh 30% Daun Guazumae, 10% Bunga Cengkeh, 15% Rimpang Temulawak, 15% Rimpang Jahe, 15% Kulit Batang Kayu Manis (Cassia), Dan bahan lainnya hingga total 100%.', 'gali singset susut perut kurang lemak tubuh daun guazumae bunga cengkeh rimpang temulawak rimpang jahe kulit batang kayu manis cassia bahan total'),
(196, 'super empot', 'Mengencangkan kembali otot otot kewanitaan, Mengurangi lendir berlebihan pada daerah kewanitaan, Memberikan kepuasan hubungan suami istri, Menjaga kesehatan wanita, Menjaga agar awet muda.', 'Kulit Buah Delima, bubuk Pronojiwo, Majakani,Akar Licorice Acutilobum, Kayu Rapet', '2 x 5 pil sehari ( pada pagi dan malam / 30 menit setelah makan ). Jamu diminum sebanyak 5 pil , yaitu pagi waktu 30 menit sesudah dan petang sesudah makan malam', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69116', 'bangkalan', 'BPOM', 'super empot Mengencangkan kembali otot otot kewanitaan, Mengurangi lendir berlebihan pada daerah kewanitaan, Memberikan kepuasan hubungan suami istri, Menjaga kesehatan wanita, Menjaga agar awet muda. Kulit Buah Delima, bubuk Pronojiwo, Majakani,Akar Licorice Acutilobum, Kayu Rapet', 'super empot encang otot otot wanita kurang lendir daerah wanita puas hubung suami istri jaga sehat wanita jaga awet muda kulit buah delima bubuk pronojiwo majakani akar licorice acutilobum kayu rapet'),
(197, 'super rapet', 'membantu mengurangi lendir', '', '3xsehari 5 butir.', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69117', 'bangkalan', 'BPOM', 'super rapet membantu mengurangi lendir ', 'super rapet bantu kurang lendir'),
(198, 'JAMU PEGEL LINU', 'mengatasi gatal2 dan bau yg kurang sedap pada wanita', '', '', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69118', 'bangkalan', 'BPOM', 'JAMU PEGEL LINU mengatasi gatal2 dan bau yg kurang sedap pada wanita ', 'jamu gel linu atas gatal bau yg sedap wanita'),
(199, 'galian rapet', 'rapat mencengkram saat berhubungan intim.hingga melestarikan hubungan suami istri ', '', '3 x sehari @5 pil sekali minum ', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69119', 'bangkalan', 'BPOM', 'galian rapet rapat mencengkram saat berhubungan intim.hingga melestarikan hubungan suami istri  ', 'gali rapet rapat mencengkram hubung intim lestari hubung suami istri'),
(200, 'jamu dalimah putih', 'dan selalu awet muda', '', '3 x sehari @ 5 biji', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69120', 'bangkalan', 'BPOM', 'jamu dalimah putih dan selalu awet muda ', 'jamu dalimah putih awet muda'),
(201, 'GALIAN SEHAT / MONTOK', 'Pil jamu ramuan Madura untuk wanita / pria yang kurang nafsu makan, berbadan kurus, muka pucat, sering sakit, badan lemah dan lain-lain. Minumlah jamu ini secara teratur supaya badan jadi sehat, segar dan montok padat berisi.', 'Rimpang Kunyit,Rimpang Temulawak, Rimpang Lengkuas,Buah Kabesak', 'Minum 3 x 5 pil / hari.', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69121', 'bangkalan', 'BPOM', 'GALIAN SEHAT / MONTOK Pil jamu ramuan Madura untuk wanita / pria yang kurang nafsu makan, berbadan kurus, muka pucat, sering sakit, badan lemah dan lain-lain. Minumlah jamu ini secara teratur supaya badan jadi sehat, segar dan montok padat berisi. Rimpang Kunyit,Rimpang Temulawak, Rimpang Lengkuas,Buah Kabesak', 'gali sehat montok pil jamu ramu madura wanita pria nafsu makan badan kurus muka pucat sakit badan lemah minum jamu atur badan sehat segar montok padat isi rimpang kunyit rimpang temulawak rimpang lengkuas buah kabesak'),
(202, 'minyak zaitun', 'Mangencangkan dan menghaluskan kulit muka dan seluruh tubuh (kulit bersisik, pecah-pecah dan kasar), dan sebagai pengganti pelembab dan bisa juga untuk minyak urut/pijat baik untuk dewasa dan anak/bayi.', '', 'Oleskan minyak zaitun secukupnya bagian kulit/tubuh yang dikehendaki.', '', 'cair', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69122', 'bangkalan', 'BPOM', 'minyak zaitun Mangencangkan dan menghaluskan kulit muka dan seluruh tubuh (kulit bersisik, pecah-pecah dan kasar), dan sebagai pengganti pelembab dan bisa juga untuk minyak urut/pijat baik untuk dewasa dan anak/bayi. ', 'minyak zaitun mangencangkan halus kulit muka tubuh kulit sisik pecah pecah kasar ganti pelembab minyak urut pijat dewasa anak bayi'),
(203, 'super pria', 'Menyembuhkan lemah syahwat dan impotensi pada laki laki, Menambah gairah bagi pria.', 'Biji Benalu,batang tumbuhan, biji pinang 20%, kulit kering  20% Dan bahan lain sampai 100%', '', '', 'pil', 'berkah madu/sumber madu', 'indonesia', 'Jl. KH. Mohamad Kholil No.50A, Demangan Timur, Demangan, Kec. Bangkalan, Kabupaten Bangkalan, Jawa Timur 69123', 'bangkalan', 'BPOM', 'super pria Menyembuhkan lemah syahwat dan impotensi pada laki laki, Menambah gairah bagi pria. Biji Benalu,batang tumbuhan, biji pinang 20%, kulit kering  20% Dan bahan lain sampai 100%', 'super pria sembuh lemah syahwat impotensi laki laki tambah gairah pria biji benalu batang tumbuh biji pinang kulit kering bahan');
